import React, { useEffect } from "react";
import "slick-carousel/slick/slick.css"; 
import "slick-carousel/slick/slick-theme.css";
import Slider from "react-slick";
import { Scrollax } from "scrollax";
import image1 from "../assets/images/bg_1.jpg";
import image2 from "../assets/images/bg_2.jpg";
import image3 from "../assets/images/bg_3.jpg";

const Main = () => {
    useEffect(() => {
        if (Scrollax) {
          Scrollax.init();
        }
        return () => {
          if (Scrollax) Scrollax.destroy(); // Cleanup on unmount
        };
      }, []);
    
      const settings = {
        dots: true,
        infinite: true,
        slidesToShow: 1,
        slidesToScroll: 1,
        autoplay: true,
        speed: 2000,
        autoplaySpeed: 2000,
        cssEase: "linear"
      };
  return (
    <div className="slider-container">
      <Slider className='home-slider' {...settings}>
        <div className="slider-item" style={{backgroundImage: `url(${image1})`}}>
            <div className="overlay"></div>
            <div className="custom-container">
                <div className="row slider-text justify-content-center align-items-center" data-scrollax-parent="true">
                    <div className="col-md-8 col-sm-12 text-center ftco-animate">
                        <span className="subheading">Welcome</span>
                        <h1 className="mb-4">The Best Coffee Testing Experience</h1>
                        <p className="mb-4 mb-md-5">A small river named Duden flows by their place and supplies it with the necessary regelialia.</p>
                        <p><a href="#" className="btn btn-primary p-3 px-xl-4 py-xl-3">Order Now</a> <a href="#" className="btn btn-white btn-outline-white p-3 px-xl-4 py-xl-3">View Menu</a></p>
                    </div>
                </div>
            </div>
        </div>
        <div className="slider-item" style={{backgroundImage: `url(${image2})`}}>
            <div className="overlay"></div>
            <div className="custom-container">
                <div className="row slider-text justify-content-center align-items-center" data-scrollax-parent="true">
                    <div className="col-md-8 col-sm-12 text-center ftco-animate">
                        <span className="subheading">Welcome</span>
                        <h1 className="mb-4">Amazing Taste &amp; Beautiful Place</h1>
                        <p className="mb-4 mb-md-5">A small river named Duden flows by their place and supplies it with the necessary regelialia.</p>
                        <p><a href="#" className="btn btn-primary p-3 px-xl-4 py-xl-3">Order Now</a> <a href="#" className="btn btn-white btn-outline-white p-3 px-xl-4 py-xl-3">View Menu</a></p>
                    </div>
                </div>
            </div>
        </div>
        <div className="slider-item" style={{backgroundImage: `url(${image3})`}}>
            <div className="overlay"></div>
            <div className="custom-container">
                <div className="row slider-text justify-content-center align-items-center" data-scrollax-parent="true">
                    <div className="col-md-8 col-sm-12 text-center ftco-animate">
                        <span className="subheading">Welcome</span>
                        <h1 className="mb-4">Creamy Hot and Ready to Serve</h1>
                        <p className="mb-4 mb-md-5">A small river named Duden flows by their place and supplies it with the necessary regelialia.</p>
                        <p><a href="#" className="btn btn-primary p-3 px-xl-4 py-xl-3">Order Now</a> <a href="#" className="btn btn-white btn-outline-white p-3 px-xl-4 py-xl-3">View Menu</a></p>
                    </div>
                </div>
            </div>
        </div>
      </Slider>
    </div>
  )
}

export default Main
